<?php

/**
 * https://leetcode.com/problems/find-the-difference
 * @param string $s
 * @param string $t
 * @return string
 */
function findTheDifference($s, $t)
{


    for ($i = 0; $i < strlen($s); $i++) {
        
        if(strpos($t,$s[$i])!==false){
            $t=substr_replace($t,'',strpos($t,$s[$i]),1);
        }
    }

    return $t;
}

// $s = "";
// $t = "";
// // t

$s = ""; $t = "e";
echo findTheDifference($s, $t);
